import React, { Component } from 'react';
import Plx from 'react-plx';
function ParallaxTest(props) {
    const parallaxData = [
        {
          start: 0,
          end: 500,
          properties: [
            {
              startValue: 1,
              endValue: 2,
              property: 'scale',
            },
          ],
        },
      ];
      class Example extends Component {
        render() {
          return (
              <div>
            <Plx
              className='MyAwesomeParallax'
              parallaxData={ parallaxData }
            >
              /* Your content */
            </Plx>
            </div>
          );
        }
      }
    
    
}

export default ParallaxTest
